// components/ProductListPage.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import ProductService from '../service/ProductService'; // Assuming you have a service for fetching product data

function ProductList() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Fetch products data when the component mounts
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await ProductService.getAllProducts();
      setProducts(response.products); // Assuming the list of products is under the key 'products'
    } catch (error) {
      console.error('Error fetching products:', error);
    }
  };

  return (
    <div className="product-list-container">
      <h2>Product List</h2>
      <div className="product-container">
        {products.map(product => (
          <div className="product-card" key={product.id}>
            <img src={product.imageUrl} alt={product.name} className="product-image" />
            <h3 className="product-name">{product.name}</h3>
            <p className="product-description">{product.description}</p>
            <div className="product-rating">
              {/* Assuming rating is an integer value */}
              {[...Array(5)].map((_, index) => (
                <span key={index} className={index < product.rating ? 'filled' : 'empty'}>
                  â˜…
                </span>
              ))}
            </div>
            <button className="view-button">
              <Link to={`/product/${product.id}`}>View</Link>
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProductList;
